var inpt = [
	'',
	'',
	'',
	'',
	''
];

((input)=>{
	var keypad = [[1,2,3], [4,5,6], [7,8,9]];
	var point =  [1, 1];
	
	var answer = ''; //Added a string output since console.log likes combining duplicate output.
	
	for(var line = 0; line < input.length; line++)
	{
		for(var step = 0; step < input[line].length; step++)
		{
			switch(input[line][step]) /* really hope this doesn't end up needing to be refactored for jagged arrays on a later day. Heaven forbid the Easter Bunny get a keypad with a 0 key.*/
			{
				case "U":
					point[0] = Math.max(0, point[0] - 1);
				break;
				case "D": 
					point[0] = Math.min(keypad[0].length - 1, point[0] + 1);
				break;
				case "L": 
					point[1] = Math.max(0, point[1] - 1);
				break;
				case "R": 
					point[1] = Math.min(keypad[point[0]].length - 1, point[1] + 1);
			}
		}
		
		answer += keypad[point[0]][point[1]];
	}
	
	console.log(answer);
})(inpt);